import React from "react";
import { Header } from "./homepage";
import { useNavigate } from "react-router";

function Main(props){
mm=use
    function logout(){
        localStorage.setItem('auth', false);

    }

    return(
        <div>
             <Header team="TEAM" home="ABOUT" navi={logout}  work="WORK" login="LOGOUT" sidebar="mainsidebar" contact="CONTACT" teamfont='fa fa-user' workfont='fa fa-th' contactfont='fa fa-envelope' loginfont='fa fa-usd' ></Header>
        </div>
    );
}

export default Main;
